import { useState } from 'react';
import '../App.css';
import navbar from '../navbar';
function homepage() {
  return (
    <div>
      <navbar/>
      <div className="content">
        <h2>Welcome to My Website!</h2>
        <p>This is the home page content.</p>
      </div>
    </div>
  );
}

export default homepage;
